	[20213] = { add_icon = "", attr_list = {}, bag_type = 2, can_use = false, desc = "利刃武器突破所需高级素材。\n只剩一层薄壳稳定外形的特殊金属，为了达到极致，工匠们不顾危险制作而成的金属，由于液体在内部翻腾导致金属本身会有心脏一般的跳动感，假若放在一起，就会形成龙一般的形态。", drop_entity_id = 21005, icon = "Textures/Icon/Single/ItemIcon/20213.png", id = 20213, is_feed = false, is_hide = false, jump_ids = {170531,2142,7,}, limit = 99999, name = "连龙胆", order_id = 972, property1 = 0, property2 = 0, quality = 4, sell_get = 0, star = 5, type = 1052, use_effect = {}, yinyang_icon = "",},
	[20221] = { add_icon = "", attr_list = {}, bag_type = 2, can_use = false, desc = "冲击武器突破所需初级素材。\n不知何处而来的物质，细如丝线，能镇魔辟邪，红缨基本只会飘散在极度危险的地方，祈求出入平安的人们往往会在自己重要之物上加绑红缨，以图吉利。", drop_entity_id = 21003, icon = "Textures/Icon/Single/ItemIcon/20221.png", id = 20221, is_feed = false, is_hide = false, jump_ids = {170532,7,}, limit = 99999, name = "稀红缨", order_id = 971, property1 = 0, property2 = 0, quality = 2, sell_get = 0, star = 3, type = 1052, use_effect = {}, yinyang_icon = "",},
