	[30153] = { add_icon = "", attr_list = {}, bag_type = 3, can_use = false, desc = "可用于角色突破。\n计都灵客施术所用的高级法器，通体紫色的玉佩内里似有光华流转。这种玉石随风暴由天月城降落至创生地，有人将其视为天月城必将陨落的不详预兆，但在灵客看来，一切皆有掌握之机。", drop_entity_id = 21004, icon = "Textures/Icon/Single/ItemIcon/30123.png", id = 30153, is_feed = true, is_hide = false, jump_ids = {2142,3,}, limit = 99999, name = "天坠巧玉", order_id = 2, property1 = 0, property2 = 0, quality = 4, sell_get = 0, star = 4, type = 1052, use_effect = {}, yinyang_icon = "",},
	[30161] = { add_icon = "", attr_list = {}, bag_type = 3, can_use = false, desc = "可用于角色突破。\n斩客手中的锐器之刃，因为长期使用已经布满豁口。这副刀刃并不为常人口中的正义而挥，因此在损坏后也无人祭奠，只是随意弃置。", drop_entity_id = 21002, icon = "Textures/Icon/Single/ItemIcon/30121.png", id = 30161, is_feed = true, is_hide = false, jump_ids = { [2] = 3,}, limit = 99999, name = "磨损的残刃", order_id = 2, property1 = 0, property2 = 0, quality = 2, sell_get = 0, star = 2, type = 1052, use_effect = {}, yinyang_icon = "",},
